var tipuesearch = {"pages": [{'title': 'youtube', 'text': '\n', 'tags': '', 'url': 'youtube.html'}, {'title': 'About', 'text': 'https://github.com/40823103/cp2019 \n \n', 'tags': '', 'url': 'About.html'}, {'title': '迴圈', 'text': 'hello.dart \n gist: https://gist.github.com/40823103/2375f66f87da8e16946c7bfb58747643 \n dartpad:\xa0 https://mde.tw/dartpad/?id=2375f66f87da8e16946c7bfb58747643 \n void main() { \n  print("哈囉");\n} \n \n \n 哈囉.dart \n gist: https://gist.github.com/40823103/13646115563172f84a505f0f1a6b1a3e \n dartpad: https://mde.tw/dartpad/?id=13646115563172f84a505f0f1a6b1a3e \n main() {\n  for (int i = 0; i < 7; i++) {\n    print(\'你在哈囉 $i\');\n  }\n  print(\'你在哈囉嗎 讚\');\n} \n \n \n \n 亂數.dart \n gist: https://gist.github.com/40823103/570700f30d8728172cdd58dcffb20132 \n dartpad: https://mde.tw/dartpad/?id=570700f30d8728172cdd58dcffb20132 \n  Run\nimport \'dart:html\';\n\nvoid main() {\n  // 每一組 10 人\n  int num = 10;\n  // 組序由 1 開始\n  int gth = 1;\n  // 迴圈序號變數\n  int i;\n  // 每組學員暫存數列\n  var gp_list = [];\n  // 全班分組數列\n  var cp2019 = [];\n\n  HttpRequest.getString(\n          \'https://mde.tw/cp2019/downloads/2019fall_cp_1a_list.txt\')\n      .then((String resp) {\n    // 利用 trim() 去除字串最後的跳行符號, 之後再利用 split() 根據 \\n 轉為數列\n    var stud_list = resp.trim().split("\\n");\n    // 數列利用 shuffle() 方法以隨機方法弄亂順序\n    stud_list.shuffle();\n    // 逐一讀取已經弄亂的學生學號數列, 利用模數運算每幾人分成一組\n    for (i = 0; i < stud_list.length; i++) {\n      // 0, 1~(num-1), num\n      if (i % num == 0) {\n        gp_list = [];\n        // 列印區隔符號\n        print(\'=\' * 20);\n        print("group $gth :");\n        print(stud_list[i]);\n        // 在各分組數列中加入將對應的學員學號\n        gp_list.add(stud_list[i]);\n        gth = gth + 1;\n      } else {\n        print(stud_list[i]);\n        // 在各分組數列中加入將對應的學員學號\n        gp_list.add(stud_list[i]);\n      }\n      if (i % num == 0) {\n        // 逐步將各組暫存的分組數列加入全班分組數列中\n        cp2019.add(gp_list);\n      }\n    }\n    // 列出全班分組數列\n    print(cp2019);\n  });\n}\n \n \n \n \n 迴圈.dart \n gist: https://gist.github.com/40823103/734a19c08c992f44e700eed0eba6d8a7 \n dartpad: https://mde.tw/dartpad/?id=734a19c08c992f44e700eed0eba6d8a7 \n int i;\nint sum;\n\nmain() {\n  sum = 0;\n  for(i=1;i <=10 ;i++){\n    sum += i;\n    print("$sum");\n  }\n print("sum = $sum");\n}\n\nfun1(){\n} \n \n \n', 'tags': '', 'url': '迴圈.html'}, {'title': '阻尼', 'text': 'gist: https://gist.github.com/40823103/8e38cc9e343217985562ed5a22f03d57 \n dartpad: https://mde.tw/dartpad/?id=8e38cc9e343217985562ed5a22f03d57 \n \n \n \n', 'tags': '', 'url': '阻尼.html'}, {'title': 'w10', 'text': 'Dart 程式 \n main   Hello   loop   dxdt   quizlet1   quizlet2   quizlet3   temperature   temperature string \n Html 程式 \n ROC Flag   Grid   X-Y Plot   Slithery   temperature   temperature string   USA Flag   rot USA Flag \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n', 'tags': '', 'url': 'w10.html'}, {'title': '攝氏華氏', 'text': '華氏轉攝氏 \n \n 攝氏轉華氏 \n \n \n \n', 'tags': '', 'url': '攝氏華氏.html'}, {'title': 'W16 查驗考試', 'text': '\n temperature\xa0 \xa0   temperature string\xa0\xa0 \n ROC Flag\xa0\xa0   USA Flag \xa0 \xa0 放大   回復 \n \n \n  for site wrap  \n \n  <script src="../cmsimde/static/chimper/js/jquery-3.3.1.min.js"></script>  \n \n \n \n \n \n \n \n \n \n \n \n <!-- \n \n \n \n', 'tags': '', 'url': 'W16 查驗考試.html'}]};